const doLoadMovies = (movies) => {
    return {
      type: 'LOADMOVIE',
      payload: movies,
    };
  };

const doEditMovie = (movie) => {
    return {
      type: 'EDITMOVIE',
      payload: movie,
    };
  };


  export  { doLoadMovies, doEditMovie }
